import React from "react";
import ReactDOM from "react-dom";



import Ppicontainer from "./Containers/Ppicontainer";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <Ppicontainer />
  </React.StrictMode>,
  rootElement
);
